import React from "react";

const Sidebar = () => {
  return (
    <div class="container-fluid">
      <div class="row">
        <div class="col-3 px-1 bg-dark position-fixed" id="sticky-sidebar">
          <h3>Navigation Menu</h3>
          <button className="btn btn-primary">Item1</button>
          <button className="btn btn-primary">Item2</button>
          <button className="btn btn-primary">Item3</button>
          <button className="btn btn-primary">Item4</button>
          <button className="btn btn-primary">Item5</button>
        </div>
        <div class="col offset-3" id="main">
          <h1>Main Area</h1>
        </div>
      </div>
    </div>
  );
};

export default Sidebar;
